const PrivateRoute = ({component: Component, ...rest }) => {
  const { currentUser } = useAuth();
  return (
    
      <Route {...rest}>
        {currentUser ? children : <Navigate to="/login" />}
      </Route>
   
  );
};

export default PrivateRoute;
